import Expenses from "./components/Expenses";

function App() {
  const expenses = [
    {
      id: "e1",
      title: "Car Insurance",
      amount: 294.57,
      date: new Date(2021, 2, 28),
    },
    {
      id: "e2",
      title: "Books",
      amount: 24.87,
      date: new Date(2021, 4, 18),
    },
    {
      id: "e3",
      title: "Pet Food",
      amount: 35.6,
      date: new Date(2021, 1, 5),
    },
    {
      id: "e4",
      title: "Maccas",
      amount: 7294.57,
      date: new Date(2021, 7, 30),
    },
  ];

  return (
    <div>
      <h2>Let's get started!</h2>
      <Expenses items= {expenses} />
    </div>
  );
}

export default App;
